   static function session(){
       $maxlifetime = time() + 18600;
       $secure = true; // if you only want to receive the cookie over HTTPS
       $httponly = false; // prevent JavaScript access to session cookie
       $samesite = 'None';

       if(PHP_VERSION_ID < 70300) {
           session_set_cookie_params($maxlifetime, '/; samesite='.$samesite, $_SERVER['HTTP_HOST'], $secure, $httponly);
       } else {
           session_set_cookie_params([
               'lifetime' => $maxlifetime,
               'path' => '/',
               'domain' => $_SERVER['HTTP_HOST'],
               'secure' => $secure,
               'httponly' => $httponly,
               'samesite' => $samesite
           ]);
       }

       if (session_status() == PHP_SESSION_NONE) {
         session_start();
       }
   }

	static function isLocal()
	{
		return in_array($_SERVER['REMOTE_ADDR'], ['127.0.0.1', '::1']);
	}

	static function permalink()
	{
		if( self::isLocal() ){
			return Config::AppUrl['dev'];
		} else {
			return Config::AppUrl['web'];
		}
	}

	static function encrypt($value, $nonce)
	{
		$encryp = new Encryption;
		$resp   = $encryp->encrypt($value, $nonce);
		return $resp;
	}

	static function writeLog($webpay=0, $error="", $compra=null, $token=null)
	{
		$fileLog = fopen(BASEPATH . '/webpay.log','a');
		if($webpay == "" || $webpay == " "){
			$webpay = "N/A";
		} else {
			$webpay = $webpay;
		}
		$string  = "[FECHA: ".date('r')."] \t [WEBPAY: ".$webpay."] \t [MENSAJE: ".$error."] \t [COMPRA NÂ°: ".$compra."] \t [TOKEN: ".$token."]";
		$string .= "\n ------------------------------------------------------------------------------------------------\n\n";
		fwrite($fileLog, $string);
		fclose($fileLog);
	}

	static function decrypt($value, $nonce)
	{
		$encryp = new Encryption;
		$resp   = $encryp->decrypt($value, $nonce);
		return $resp;
	}

	static function genetarePass()
	{
		$caracteres='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';

		$longpalabra=8;

		for($pass='', $n=strlen($caracteres)-1; strlen($pass) < $longpalabra ; ) {
			$x = rand(0,$n);
			$pass.= $caracteres[$x];
		}

		$passen = [
			"encrypt" => Auth::encriptar($pass),
			"decript" => $pass
		];

		return $passen;
	}

